import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(()=>{
    fetch('https://dummyjson.com/products/1').then((data)=>{
        data.json().then(result =>{
            console.log(result);
            setUser(result.data)
        })
    })
  },[])
  return (
    <>
      <table border="1px">

            {
                user.map((item,index)=>
               <div key={index}>
                <h1>{item.id}</h1>
               </div>
                )
            }
      </table>
    </>
  );
};

export default Api;
